import React, { useState } from 'react';
import { useEffect } from 'react';


export default function PageAccueil() {
  const [first, setFirst] = useState(0);

  useEffect(() => {
    let myInterval = setInterval(() => {
      setFirst(first+1);
  }, 1000);
  });
  
  return (
    <div>
        {first};
    </div>
  )
}
